  false,\n\t\"url\": null,\n\t\"notes\": \"This is a point data set depicting outfall
  locations of wastewater facilities in Missouri with National Pollutant Discharge
  Elimination System (NPDES) operating permits. As authorized by Section 402 of the
  Clean Water Act, the NPDES permit program controls water pollution by regulating
  point sources that discharge pollutants into the waters of the United States. Point
  sources are discrete conveyances such as pipes or man-made ditches. Wastewater discharges
  regulated under the NPDES program include but not limited to facilities such as
  industrial or commercial facilities, sewage treatment plants, transportation terminals
  and Combined Sewer Overflows (CSOs).\",\n\t\"license_title\": null,\n\t\"extras\":
